import React from 'react';
import {
    Route,
    Link,
    Switch
} from 'react-router-dom';

const Title = () => {
    return (
        <div className="title">
            <h1>Fitness Trac.kr</h1>
            <nav>
                <a href='#'>Home</a>
                <a href='#'>Routines</a>
                <a href='#'>My Routines</a>
                <a href='#'>Activities</a>
                <a href='#'>Log in / Register</a>
                <Switch>
                    <Route path='/routines'>
                        {/* <Routines /> */}
                    </Route>
                    <Route path='/my-routines'>
                        {/* <MyRoutines /> */}
                    </Route>
                    <Route path='/activities'>
                        {/* <Activities /> */}
                    </Route>
                    <Route path='/'>
                        {/* <Home /> */}
                    </Route>
                </Switch>
            </nav>
        </div>
    )
}

export default Title;
